    false,nt"url": null,nt"notes": "The Geographic Names Information System
    (GNIS) is the Federal standard for geographic nomenclature in support of the U.S.
    Board on Geographic Names. The Structures layer (STRUCTURE) in the GNIS Web Map
    Service contains all features in the database with Feature Class of Airport, Building,
    Church, Hospital, School, Post Office. See http://geonames.usgs.gov/domestic/feature_class.htm
    for feature class values and definitions. The STRUCTURE_FEATURE250 layer contains
    large features designated by the Geographic Names Office as ones that should be
